 @Nooticus  You're missing a crucial component which are the people. BBQ with your family is culture, traditional Cajun food is culture,  stuffed turkey is culture. They come from the ground up and are based on a tradition belonging to a certain people. Without a folk there is no culture and a global mega-corporation is pretty much the antonym of folk.

It's the same thing for music. Country music is culture, Taylor Swift isn't. She's a product and you can like the product very much, but she doesn't represent anyone if not her record label.

I agree that it's wrong to say that America has no culture, and this comes from an Italian. I think that what people mean, and you exemplify that, is that too many Americans have no idea about what "culture" even is since they live in their own ultra-consumeristic microcosm. And this is not their fault by the way.

